import { Link } from "react-router-dom";


const Navigation = () => {

return (
<div className="container-fluid col-xs-12">  

    <div className="row g-5 flex-nowrap">
      
                <ul className="nav nav-pills flex-column g-5">
                    <li className="nav-item mb-3 p-3">
                        <Link  className="nav-link align-middle px-3" to = '/newUser'>
                           Register New User
                        </Link>
                    </li>
                  
                    <li className="nav-item mb-3 p-3">
                        <Link className="nav-link align-middle" to ='/userInfo'>
                           Check User Information
                        </Link>
                    </li>
                   
                    <li className="nav-item mb-3 p-3">
                        <Link className="nav-link pb-3 mb-3 align-middle" to='/history'>
                            Purchase History 
                        </Link>
                    
                    </li>
                </ul>
                
                
                    </div>            {/* </div>) */}
 </div>
)}
            

export default Navigation;
